  \"union-slough-national-wildlife-refuge-annual-narrative-report-calendar-year-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Union
  Slough National Wildlife Refuge and Wetland Management District summarizes Refuge
  activities during the 1992 calendar year.  The report begins with a summary of the
  yearu2019s highlights and climatic conditions.  The report includes a planning section
  which discusses the management plan, research, and investigations.  Refuge administration
  is outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given.  Habitat management is also covered.  Subjects include
  wetlands, croplands, grasslands, haying, fire management, and pest control.  The
  wildlife section of the report discusses wildlife diversity, endangered species,
  threatened species, waterfowl, marsh birds, water birds, shorebirds, raptors, game
  mammals, fisheries resources, wildlife propagation and stocking, animal control,
  and marking/banding.  The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife
  observation, picnicking, and law enforcement.  The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment utilization/replacement, communications systems, computer
  systems, and energy conservation.  Cooperative programs and items of interest are
  provided at the end; Refuge brochures are attached.\",\n\t\"license_title\": \"License
